final void seek(long pointer, int p, Term t, TermInfo ti)
     throws IOException {
  input.seek(pointer);
  position = p;
  term = t;
  prev = null;
  termInfo.set(ti);
  growBuffer(term.text.length());		  // copy term text into buffer
}

